import React from "react";
import {Router, Route, Link} from "react-router-dom"
import { render } from "@testing-library/react";
import Home from "./containers/Home";

function App (){
    return (
        <>
        <Switch >
        <Router>
            <Route exact path="/" component={Home}/>
        </Router>
        </Switch>
        </>
    )
}

export default App;
